import React, { Component } from 'react';

import '../style.css';

class Interests extends React.Component {
  render(){
    return(
      <div className="container mt-4">
        <h1>Interests</h1>
        <h2>Intro.</h2>
        <ul>
            <li>Name: Yu Ohno（大野 優）</li>
            <li>Birthday: December 26, 1996</li>
            <li>Blood Type: AB</li>
        </ul>

      </div>

      )
  }
}

export default Interests;
